import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const b=JSON.parse('{"title":"DROP OWNED","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_OWNED.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_OWNED.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_OWNED.md"};function n(d,e,r,l,c,h){return o(),t("div",null,e[0]||(e[0]=[s('<h1 id="drop-owned" tabindex="-1">DROP OWNED <a class="header-anchor" href="#drop-owned" aria-label="Permalink to &quot;DROP OWNED&quot;">​</a></h1><p>Removes database objects owned by a database role.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP OWNED BY { &lt;name&gt; | CURRENT_USER | SESSION_USER } [, ...] [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP OWNED</code> drops all of the objects in the current database that are owned by one of the specified roles. Any privileges granted to the given roles on objects in the current database or on shared objects (databases, tablespaces) will also be revoked.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name of a role whose objects will be dropped, and whose privileges will be revoked.</p><p>CASCADE : Automatically drop objects that depend on the affected objects, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the objects owned by a role if any other database objects depend on one of the affected objects. This is the default.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p><code>DROP OWNED</code> is often used to prepare for the removal of one or more roles. Because <code>DROP OWNED</code> only affects the objects in the current database, it is usually necessary to run this command in each database that contains objects owned by a role that is to be removed.</p><p>Using the <code>CASCADE</code> option may make the command recurse to objects owned by other users.</p><p>The <a href="./REASSIGN_OWNED.html">REASSIGN OWNED</a> command is an alternative that reassigns the ownership of all the database objects owned by one or more roles. However, <code>REASSIGN OWNED</code> does not deal with privileges for other objects.</p><p>Databases and tablespaces owned by the role(s) will not be removed.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove any database objects owned by the role named <code>sally</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP OWNED BY sally;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The <code>DROP OWNED</code> command is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./REASSIGN_OWNED.html">REASSIGN OWNED</a>, <a href="./DROP_ROLE.html">DROP ROLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',23)]))}const m=a(i,[["render",n]]);export{b as __pageData,m as default};
